
local tonumber, char, _, ns = tonumber, string.char, ...
local mxid, type, floor, band, rshift, data = 2917, type, math.floor, bit.band, bit.rshift, ([[]]):gsub('..', function(h) return char(tonumber(h, 16)) end)

function ns.CheckMountColor(mountID, r, g, b, threshold)
	if type(mountID) ~= "number" or mountID > mxid then return false end
	threshold = threshold or 16
	local indexPos = mountID * 2 - 1
	local offset = data:byte(indexPos) + data:byte(indexPos + 1) * 256
	if offset == 0 then return false end
	local num = data:byte(offset)
	offset = offset + 1

	local r5 = floor(r * 31 + .5)
	local g5 = floor(g * 31 + .5)
	local b5 = floor(b * 31 + .5)

	for i = 1, num do
		for j = 1, 5 do
			local color555 = data:byte(offset) + data:byte(offset + 1) * 256
			local mr5 = band(rshift(color555, 10), 0x1F)
			local mg5 = band(rshift(color555, 5), 0x1F)
			local mb5 = band(color555, 0x1F)

			local dr = r5 - mr5
			local dg = g5 - mg5
			local db = b5 - mb5

			if dr*dr + dg*dg + db*db <= threshold then return true end
			offset = offset + 2
		end
	end
	return false
end
